@EU_Commission #FutureofEurope is to tell citizens that only a few countries are able to be free??
Not the ones with a fascist neighbour that chains you (CatalanCountries), like Spain.
Which have all rights on you.. to put into prison your govt.. if you dare a Referendum 😳,how can we Cat dare?

@EU_Commission Please equalize the number of women and men at mines, oil platforms, army, construction sites, fire departments etc.
Please also equalize the av lifespan of men and women.
It would also be nice to have one category instead of two in sports. Let men and women compete together.

@EU_Commission Anyway, women live longer than men on avg. More men die at battlefields. Vast majority of workers at mines, oil platforms, construction sites etc. are male.
There are separate events for men and women in sports.
Are you going to equalize that?

@EU_Commission Women and men ARE NOT equal.
We are different biologically and psychologically.
Remember, equal rights is not the same thing as equality.
